import React from 'react'

const NavigationItems = (props) => {

    let classList = "nav-item "

    props.active?classList+="active":null


    return (
        <div>
           <li class={classList}>
                    <a class="nav-link" href="javascript:void(0);"><i class="far fa-address-book"></i>Global Stats</a>
                </li>
        </div>
    )
}

export default NavigationItems
